import React, { useState, useEffect } from "react";
import { Route } from "react-router-dom";
import axios from "axios";

// clients
import Teams from "./components/pages/clients/Teams";
import UpdateTeam from "./components/pages/clients/UpdateTeam";
import AddTeam from "./components/pages/clients/AddTeam";

function Client() {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    axios
      .get(" http://localhost:4000/api/clients")
      .then((res) => setPosts(res.data))
      .catch((error) => console.log(error));
  });

  return (
    <div className="Client">
      {/* Get Data */}
      <Route exact path="/clients" render={() => <Teams posts={posts} />} />

      {/* Add Data */}

      <Route path="/add-client" component={AddTeam} />

      {/* Update Data */}
      <Route
        path="/update-client/:id"
        render={(props) => <UpdateTeam {...props} posts={posts} />}
      />
      {/* <Route
        path="/article/:id"
        render={(props) => <Article {...props} posts={posts} />}
      /> */}
    </div>
  );
}

export default Client;
